// src/HomePage.tsx

import React from 'react';
import './HomePage.css';

const HomePage: React.FC = () => {
    return (
        <div className="home-page">
            <h1>Welcome to My Home Page</h1>
            <button className="interactive-button">Click Me</button>
        </div>
    );
}

export default HomePage;
